import React from 'react';
import { StyleSheet, Text, View } from 'react-native';


const session3 = () => (
  <View style={styles.container}>
    <Text style={styles.exercice}> (2x10) Rotation externe de l'épaule (échauffement)</Text> 
    <Text style={styles.exercice}> (3x10) Développé militaire debout</Text>
    <Text style={styles.exercice}> (3x10) Soulevé de terre jambes tendu</Text>
    <Text style={styles.exercice}> (3x10) Extension des mollets</Text>
    <Text style={styles.exercice}> (15min) Rameur ou Escalier</Text>
  </View>
);

const styles = StyleSheet.create({
  container: {
    backgroundColor: 'black',
    height: 1000,
  },

  exercice: {
    padding: 20,
    color: 'white',
    fontSize: 20,
  },
});

export default session3;
